import React, { Component } from 'react'
//Prop-Type
import PropTypes from 'prop-types';

class Content extends Component {
    static propTypes = {
        children: PropTypes.element.isRequired
    };
    render() {
        const { children } = this.props;
        return (
            <main>
                {children}
            </main>
        )
    }
}
export default Content;
